// ==UserScript==
// @name           What.CD :: Bigger To-Top Arrow
// @namespace      http://www.what.cd
// @description    Replaces text up arrow with larger image up arrow that matches your stylesheets's "go to last unread post" arrow
// @include        http*://*what.cd/forums.php?*action=viewthread&threadid=*
// @include        http*://*what.cd/userhistory.php?*action=posts&userid=*
// @include        http*://*what.cd/torrents.php?id=*
// @version	1.1
// ==/UserScript==

(function() {
	var img_src
	var matches
	
	/* Variables to choose from for custom_value (only relevant to user's with custom stylesheets) */
	var anorex_eyecandy = 'data:image/png;base64,'
	var layercake_shiro_whatnificient = 'data:image/png;base64,'
	var minimal_zeal_postmod = 'data:image/png;base64,'
	var whatlove_proton_darkambient = 'data:image/png;base64,'
	var kuro = 'data:image/png;base64,'
	var bluebit = 'data:image/png;base64,'
	var hydro = 'data:image/png;base64,'
	var decibel = 'data:image/png;base64,'
	
	/*    ONLY EDIT THE FOLLOWING LINE    */
	var custom_value = whatlove_proton_darkambient /* replace this value (on the right of the equals sign) with one of the variables above */
	/*         ONLY EDIT THE ABOVE LINE         */
	
	matches = document.documentElement.innerHTML.match("static/styles/[a-zA-Z0-9_]{1,}");
	if (matches != null ) {
		matches = matches[0].split("/"); 
		switch (matches[2]) {
			case "layer_cake": img_src = layercake_shiro_whatnificient; break;
			case "kuro": img_src = kuro; break;
			case "shiro": img_src = layercake_shiro_whatnificient; break;
			case "whatlove": img_src = whatlove_proton_darkambient; break;
			case "bluebit": img_src = bluebit; break;
			case "proton": img_src = whatlove_proton_darkambient; break;
			case "whatnificent": img_src = layercake_shiro_whatnificient; break;
			case "hydro": img_src = hydro; break;
			case "anorex": img_src = anorex_eyecandy; break;
			case "decibel": img_src = decibel; break;
			case "dark_ambient": img_src = whatlove_proton_darkambient; break;
			case "minimal": img_src = minimal_zeal_postmod; break;
			case "eye_candy": img_src = anorex_eyecandy; break;
			case "zeal": img_src = minimal_zeal_postmod; break;
			case "postmod": img_src = minimal_zeal_postmod; break;
			
			case "global": img_src = custom_value; break;
		}
	} else {
		img_src = whatlove_proton_darkambient;
	}
	
	matches = document.documentElement.innerHTML.match(/id=\"bar[0-9]{1,}/gi);
	if (matches != null ) {
		for (i = 0; i < matches.length; i++) { 
			matches[i] = matches[i].replace("id=\"", "");
			document.getElementById('' + matches[i] + '').innerHTML = document.getElementById('' + matches[i] + '').innerHTML.replace(eval("'\\u2191';"), '<img src="' + img_src + '" style="vertical-align: top;" />');
		}
	}
	
	/* Script Update Checker from: http://userscripts.org/scripts/show/20145 */
	var SUC_script_num = 65852; // Change this to the number given to the script by userscripts.org (check the address bar)
	try{function updateCheck(forced){if ((forced) || (parseInt(GM_getValue('SUC_last_update', '0')) + 86400000 <= (new Date().getTime()))){try{GM_xmlhttpRequest({method: 'GET',url: 'http://userscripts.org/scripts/source/'+SUC_script_num+'.meta.js?'+new Date().getTime(),headers: {'Cache-Control': 'no-cache'},onload: function(resp){var local_version, remote_version, rt, script_name;rt=resp.responseText;GM_setValue('SUC_last_update', new Date().getTime()+'');remote_version=parseInt(/@uso:version\s*(.*?)\s*$/m.exec(rt)[1]);local_version=parseInt(GM_getValue('SUC_current_version', '-1'));if(local_version!=-1){script_name = (/@name\s*(.*?)\s*$/m.exec(rt))[1];GM_setValue('SUC_target_script_name', script_name);if (remote_version > local_version){if(confirm('There is an update available for the Greasemonkey script "'+script_name+'."\nWould you like to go to the install page now?')){GM_openInTab('http://userscripts.org/scripts/show/'+SUC_script_num);GM_setValue('SUC_current_version', remote_version);}}else if (forced)alert('No update is available for "'+script_name+'."');}else GM_setValue('SUC_current_version', remote_version+'');}});}catch (err){if (forced)alert('An error occurred while checking for updates:\n'+err);}}}GM_registerMenuCommand(GM_getValue('SUC_target_script_name', '???') + ' - Manual Update Check', function(){updateCheck(true);});updateCheck(false);}catch(err){}
	/* Script Update Checker from: http://userscripts.org/scripts/show/20145 */
})();